1.body:
Northstar interacts with clients through a TCP socket. The clients exchange messages with Northstar in the form of requests and responses encoded in JSON . These requests and responses are a direct serialization of the structures defined in api/model.rs. The first step is to establish a connection with Northstar using a socket. import socket s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
s.connect(("localhost", 4200)) Northstar uses the port 4200 by default. Check the configuration (see northstar.toml) for the port used by the target instance. The messages sent between Northstar and the clients have two fields, id and payload. The id field is a generated UUID version 4 identifier used to tag a message exchange. { "id": "UUID", "payload": { MESSAGE_TYPE: { ... } }
} The MESSAGE_TYPE can be either "Request", "Response", or "Notification". Northstar should only send responses and notifications to clients.

2.body:
Repositories are used to group sets of containers. These are specified in the Northstar configuration (see northstar.toml). Containers can be added or removed from repositories at runtime by installing and uninstalling them. Repositories specified in the configuration are accessed at the start of Northstar. Currently it is not possible to add or remove repositories at runtime. If a repository specifies a signing key in the configuration, the contents of the containers are checked with their signature information. Otherwise, this step is skipped. Notice that for the verification step, it is required that the underlying system has verity support enabled. Containers installed at runtime to repositories with a signing key will also be verified. The next block shows the JSON structure that represents the request for the repository configuration. It is important to encode this structure without the new lines. Also a new line has to be appended to the end of the serialized string. { "id": "XXXXXXXX-XXXX-XXXX-XXXX-XXXXXXXXXXXX", "payload": { "Request": "Repositories" }
} Here is an example that sends a request for the repository configuration: import uuid
import json s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
s.connect(("localhost", 4200)) # API Request for repository information
request = { 'id': str(uuid.uuid4()), 'payload': { 'Request': 'Repositories' }
} # It is required for the API requests to be terminated with a new line '\n'
request = json.dumps(request) + '\n' # send the request
s.send(request.encode('utf-8')) # receive the list of repositories
response = s.recv(8000) # decode the response
response = json.loads(response.decode('utf-8')) # The response contains a list with the configured repositories
# Currently, only the filesystem path of every repository is provided
# e.g. {'Response': {'Repositories': {'default': {'dir': 'target/northstar/repository'}}}}
print(response['payload'])

5.body:
Northstar has a notification system where messages are sent to the clients with information about events such as: Applications starting Applications stopping Applications installed Applications uninstalled Exit status of applications Shutdown of the runtime Applications running out of memory Here is the JSON structure requesting that Northstar start a container. CONTAINER_NAME is the name of the container specified in the manifest that will be started. { "id": "XXXXXXXX-XXXX-XXXX-XXXX-XXXXXXXXXXXX", "payload": { "Request": { "Start": CONTAINER_NAME } }
} In the following snippet, a request is sent to start the memeater example container. After the container is started, we will receive 2 notifications, one signaling the start of the application, and eventually a second one that signals the termination of the application (after consuming all the memory, as this example is designed to do). # start memeater container
request = { 'id': str(uuid.uuid4()), 'payload': { 'Request': { 'Start': "memeater" } }
} # Serialize the request, notice the appended new line
request = json.dumps(request) + '\n' # Encode and send the request
s.send(request.encode('utf-8')) # Receive the ok response to the request
# {'Response': {'Ok': None}}
response = s.recv(8000)
print(json.loads(response.decode('utf-8'))) # Receive the first notification for the start of the container
# {'Notification': {'ApplicationStarted': ['memeater', '0.0.1']}}
response = s.recv(8000)
print(json.loads(response.decode('utf-8'))) # Receive the notification for the out of memory
# {'Notification': {'OutOfMemory': 'memeater'}}
response = s.recv(8000)
print(json.loads(response.decode('utf-8')))

